import React from "react";
import { Link } from "react-router-dom";
import "./Home.css"

const Home = () => {
	return (
		<div>
			<h1 className="title">INTERVALS APP</h1>
			<Link to="/stopwatch">GET STARTED!</Link>
		</div>
	)
};

export default Home;
